import React from "react";

import Baby_Jogger from "../Pictures/Baby_Jogger.png";
import $ from "jquery";

import Baby_carriage from "../Pictures/Baby_carriage.jpg";

// import "../css/Carousel.scss";

function Carousel() {
  return (
    <div class="top-content">
      <div class="container-fluid">
        <div id="carousel-example" class="carousel slide" data-ride="carousel">
          <div class="carousel-inner row w-100 mx-auto" role="listbox">
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/1.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/2.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/3.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/4.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>

            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/5.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/6.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/7.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
            <div className="carousel-item col-12 col-sm-6 col-md-4 col-lg-3">
              <img
                src="assets/img/backgrounds/8.jpg"
                className="img-fluid mx-auto d-block"
                alt="img8"
              />
            </div>
          </div>
          <a
            className="carousel-control-prev"
            href="#carousel-example"
            role="button"
            data-slide="prev"
          >
            <span
              className="carousel-control-prev-icon"
              aria-hidden="true"
            ></span>
            <span className="sr-only">Previous</span>
          </a>
          <a
            className="carousel-control-next"
            href="#carousel-example"
            role="button"
            data-slide="next"
          >
            <span
              className="carousel-control-next-icon"
              aria-hidden="true"
            ></span>
            <span className="sr-only">Next</span>
          </a>
        </div>
      </div>
    </div>
  );
}
export default Carousel;
